import React, { useState, useEffect } from 'react';
import authService from '../../services/authService'; // Ajusta la ruta según tu estructura
import CrearCursoForm from './CrearCursoForm';
import CrearProfesorForm from './CrearProfesorForm';
import CrearEstudianteForm from './CrearEstudianteForm';
import CrearAsignaturaForm from './CrearAsignaturaForm';
import VerCursos from './VerCursos';
import VerProfesores from './VerProfesores';
import VerEstudiantes from './VerEstudiantes';
import VerAsignaturas from './VerAsignaturas';
import Reportes from './Reportes';

function DirectorDashboard() {
  const [user, setUser] = useState(null);
  const [selectedOption, setSelectedOption] = useState('cursos'); // Estado para manejar la opción seleccionada

  useEffect(() => {
    const fetchUserData = async () => {
      try {
        const userData = await authService.getUserData(); // Función para obtener datos del usuario
        setUser(userData);
      } catch (error) {
        console.error("Error al obtener datos del usuario:", error);
        // Manejar el error, por ejemplo, redirigiendo al login
      }
    };
    fetchUserData();
  }, []);

  if (!user) {
    return <div>Cargando...</div>;
  }

  const renderContent = () => {
    switch (selectedOption) {
      case 'cursos':
        return (
          <div>
            <CrearCursoForm />
            <VerCursos />
          </div>
        );
      case 'asignaturas':
        return (
          <div>
            <CrearAsignaturaForm />
            <VerAsignaturas />
          </div>
        );
      case 'profesores':
        return (
          <div>
            <CrearProfesorForm />
            <VerProfesores />
          </div>
        );
      case 'estudiantes':
        return (
          <div>
            <CrearEstudianteForm />
            <VerEstudiantes />
          </div>
        );
      case 'reportes':
        return <Reportes />;
      default:
        return <div>Selecciona una opción del menú.</div>;
    }
  };

  return (
    <div style={{ display: 'flex', height: '100vh' }}>
      {/* Menú Lateral */}
      <div
        style={{
          width: '200px',
          backgroundColor: '#f4f4f4',
          padding: '20px',
          boxSizing: 'border-box',
        }}
      >
        <h3>Menú</h3>
        <ul style={{ listStyleType: 'none', padding: 0 }}>
          <li><strong>Cursos</strong>
            <ul>
              <li onClick={() => setSelectedOption('cursos')}>Crear Cursos</li>
              <li onClick={() => setSelectedOption('cursos')}>Ver Cursos</li>
            </ul>
          </li>
          <li><strong>Asignaturas</strong>
            <ul>
              <li onClick={() => setSelectedOption('asignaturas')}>Crear Asignaturas</li>
              <li onClick={() => setSelectedOption('asignaturas')}>Ver Asignaturas</li>
            </ul>
          </li>
          <li><strong>Profesores</strong>
            <ul>
              <li onClick={() => setSelectedOption('profesores')}>Crear Profesores</li>
              <li onClick={() => setSelectedOption('profesores')}>Ver Profesores</li>
            </ul>
          </li>
          <li><strong>Estudiantes</strong>
            <ul>
              <li onClick={() => setSelectedOption('estudiantes')}>Crear Estudiantes</li>
              <li onClick={() => setSelectedOption('estudiantes')}>Ver Estudiantes</li>
            </ul>
          </li>
          <li><strong>Reportes</strong>
            <ul>
              <li onClick={() => setSelectedOption('reportes')}>Ver Reportes</li>
            </ul>
          </li>
        </ul>
      </div>

      {/* Contenido Principal */}
      <div
        style={{
          flex: 1,
          padding: '20px',
          boxSizing: 'border-box',
        }}
      >
        <h1>Bienvenido, {user.nombre}</h1>
        {renderContent()}
      </div>
    </div>
  );
}

export default DirectorDashboard;
